import React, { useState } from "react";
import './Styles/App.css'
import Block from "./Components/block/block";

function App() {
  const [counter, setCounter] = useState(0);
  function increment(){
    setCounter(counter+1)
  }
  return (
    <div className="App">
      <div className="block3x3">
      <Block func={increment}/>
      <Block func={increment}/>
      </div>
    </div>
  );
}

export default App;
